gi prima la documentazione Matomo/Piwik sull\'integrazione visto che potresti aver bisogno di configurare l\'installazione di Matomo/Piwik per utilizzare tutte le funzionalità.\";s:9:\"piwik_url\";s:37:\"URL Matomo/Piwik (incluso protocollo)\";s:18:\"piwik_api_settings\";s:16:\"Integrazione API\";s:24:\"piwik_api_client_options\";s:18:\"Opzioni client API\";s:36:\"piwik_api_client_options_description\";s:270:\"Puoi definire opzioni programma Guzzle come stringa JSON che saranno utilizzate nelle richieste a chiamate API. Consulta la <a target=\'_blank\' href=\'http://docs.guzzlephp.org/en/stable/request-options.html\'>documentazione Guzzle</a> per una lista completa delle opzioni.\";s:12:\"piwik_tokens\";s:23:\"Token di autenticazione\";s:15:\"piwik_api_token\";s:9:\"Token API\";s:20:\"piwik_api_token_info\";s:212:\"Token di autenticazione utilizzato per inviare richieste API (es. per aggiornare le impostazioni del sito). Se il token non è impostato, gli aggiornamenti Matomo/Piwik richiesti da PImcore non saranno possibili.\";s:21:\"piwik_api_create_site\";s:12:\"Crea via API\";s:29:\"piwik_api_create_site_tooltip\";s:33:\"Crea un nuvo sito in Matomo/Piwik\";s:29:\"piwik_api_create_site_success\";s:41:\"Creato un nuovo sito con API Matomo/Piwik\";s:29:\"piwik_api_create_site_failure\";s:42:\"Fallito un nuovo sito con API Matomo/Piwik\";s:21:\"piwik_api_update_site\";s:16:\"Aggiorna via API\";s:29:\"piwik_api_update_site_tooltip\";s:56:\"Aggiorna config sito (lista domini) con API Matomo/Piwik\";s:29:\"piwik_api_update_site_success\";s:43:\"Aggiornata config sito con API Matomo/Piwik\";s:29:\"piwik_api_update_site_failure\";s:59:\"Fallito l\'aggiornamento di config sito con API Matomo/Piwik\";s:18:\"piwik_report_token\";s:13:\"Segnala Token\";s:23:\"piwik_report_token_info\";s:226:\"Token di autenticazione utilizzato per integrare widget di rapporto e cruscotti. Se non impostato, la ricezione di rapporti da Pimcore non sarà possibile. È consigliata l\'indicazione di un token con permessi di sola lettura.\";s:24:\"piwik_iframe_integration\";s:19:\"Integrazione Iframe\";s:29:\"piwik_iframe_integration_info\";s:180:\"Puoi incorporare l\'intera applicazione Matomo/Piwik come iframe consentendo a Pimcore la generazione di un URL \'logme\' che registra automaticamente l\'utente scelto in Matomo/Piwik.\";s:21:\"piwik_iframe_username\";s:19:\"Utente Matomo/Piwik\";s:21:\"piwik_iframe_password\";s:27:\"Password (MD5) Matomo/Piwik\";s:26:\"piwik_iframe_password_info\";s:80:\"La password deve consistere di un hash MD5 della password Matomo/Piwik corrente.\";s:25:\"branding_logo_description\";s:101:\"Usato nella schermata di accesso ed avvio. Consigliato un file SVG (sono anche supportati JPG & PNG).\";s:23:\"appearance_and_branding\";s:19:\"Aspetto & identità\";s:20:\"web2print_apiKey_txt\";s:86:\"Se l\'istanza di PDFreactor è impostata per richiedere chiavi API, puoi inserirla qui.\";s:13:\"used_by_class\";s:16:\"Usato da classe:\";s:17:\"uses_these_bricks\";s:23:\"Utilizza questi bricks:\";s:19:\"analytics_gtag_code\";s:29:\"Usa codice GTag per analytics\";s:30:\"targeting_toolbar_browser_note\";s:409:\"<b>NOTA:</b> L\'abilitazione degli strumenti di obiettivo riguarda solo la sessione della postazione corrente. Se vuoi utilizzare gli strumenti su una postazione diversa devi abilitarlo di nuovo. Leggi la <a target=\'_blank\' href=\'https://pimcore.com/docs/5.1.x/Development_Documentation/Tools_and_Features/Targeting_and_Personalization/index.html#page_Debugging-Targeting-Data\'>documentazione</a> per dettagli.\";s:10:\"deactivate\";s:9:\"Disattiva\";s:18:\"admin_translations\";s:25:\"Traduzioni amministratore\";s:22:\"debug_override_warning\";s:314:\"<strong>ATTENZIONE:</strong> Se la modalità debug è impostata in modo esplicito da codice, questa impostazione sarà ignorata. Vedi la <a target=\'_blank\' href=\'https://pimcore.com/docs/5.1.x/Development_Documentation/Development_Tools_and_Details/Feature_Flags_And_Debug_Mode.html\'>documen